import React from "react";
import Card from "../UI/Card";
import classes from "./Menu.module.css";
const Menu = () => {
	return (
		<div className="row">
				<div className={classes.menu}>
					<ul className={classes.ul_menu}>
						<li className={classes.li_menu}>Eventos</li>
						<li className={classes.li_menu}>Galeria </li>
						<li className={classes.li_menu}>Galeria </li>
						<li className={classes.li_menu}>Contactos</li>
						<li className={classes.li_menu}>Contactos</li>
						<li className={classes.li_menu}>¿ Quiénes somos ?</li>
					</ul>
				</div>
		</div>
	);
};

export default Menu;
